// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    struct Candidate {
        string name;
        uint256 voteCount;
    }

    struct Voter {
        bool hasVoted;
        uint256 vote;
    }

    address public admin;
    mapping(address => Voter) public voters;
    Candidate[] public candidates;
    uint256 public votingStart;
    uint256 public votingEnd;

    event CandidateAdded(string name);
    event Voted(address voter, uint256 candidateId);
    event VotingStarted(uint256 startTime, uint256 endTime);
    event VotingEnded(uint256 winningCandidateId);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier votingOpen() {
        require(block.timestamp >= votingStart && block.timestamp < votingEnd, "Voting is not open");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function addCandidate(string memory _name) public onlyAdmin {
        require(votingStart == 0, "Cannot add candidates after voting has started");
        candidates.push(Candidate({
            name: _name,
            voteCount: 0
        }));
        emit CandidateAdded(_name);
    }

    function startVoting(uint256 _durationInMinutes) public onlyAdmin {
        require(votingStart == 0, "Voting has already started");
        require(candidates.length > 1, "Need at least two candidates to start voting");
        votingStart = block.timestamp;
        votingEnd = votingStart + (_durationInMinutes * 1 minutes);
        emit VotingStarted(votingStart, votingEnd);
    }

    function vote(uint256 _candidateId) public votingOpen {
        require(!voters[msg.sender].hasVoted, "You have already voted");
        require(_candidateId < candidates.length, "Invalid candidate ID");

        voters[msg.sender].hasVoted = true;
        voters[msg.sender].vote = _candidateId;
        candidates[_candidateId].voteCount++;

        emit Voted(msg.sender, _candidateId);
    }

    function endVoting() public onlyAdmin {
        require(block.timestamp >= votingEnd, "Voting period has not ended yet");
        require(votingEnd != 0, "Voting has not started");

        uint256 winningCandidateId = getWinningCandidate();
        emit VotingEnded(winningCandidateId);
    }

    function getWinningCandidate() public view returns (uint256 winningCandidateId) {
        uint256 winningVoteCount = 0;
        for (uint256 i = 0; i < candidates.length; i++) {
            if (candidates[i].voteCount > winningVoteCount) {
                winningVoteCount = candidates[i].voteCount;
                winningCandidateId = i;
            }
        }
    }

    function getCandidateCount() public view returns (uint256) {
        return candidates.length;
    }

    function getVoterInfo(address _voter) public view returns (bool hasVoted, uint256 vote) {
        return (voters[_voter].hasVoted, voters[_voter].vote);
    }
}
